import { BrowserRouter, Route, Swith } from 'react-router-dom';
import StorePicker from "./StorePicker";

const Router = () => (
    <BrowserRouter>
        <switch>
            <Route exact path="/" component={StorePicker} />
        </switch>
    </BrowserRouter>
)
